import React from "react";
import "./Footer.css";

const Footer = () => {
  return (
    <div className="footer">
      <div>Visited nodes</div>
      <div>Resulting path</div>
      <div>Origin</div>
      <div>Destination</div>
    </div>
  );
};

export default Footer;
